    detB=((v(t(k,2),1)-v(t(k,1),1)).*(v(t(k,4),2)-v(t(k,1),2)).*(v(t(k,5),3)-v(t(k,1),3)));
    
    DxDxval=detB.*(1./(v(t(k,2),1)-v(t(k,1),1)).^2).*DxDx;
    DyDyval=detB.*(1./(v(t(k,4),2)-v(t(k,1),2)).^2).*DyDy;
    DzDzval=detB.*(1./(v(t(k,5),3)-v(t(k,1),3)).^2).*DzDz;
    DxDyval=detB.*(1./((v(t(k,2),1)-v(t(k,1),1)).*(v(t(k,4),2)-v(t(k,1),2)))).*DxDy;
    DxDzval=detB.*(1./((v(t(k,2),1)-v(t(k,1),1)).*(v(t(k,5),3)-v(t(k,1),3)))).*DxDz;
    DyDzval=detB.*(1./((v(t(k,4),2)-v(t(k,1),2)).*(v(t(k,5),3)-v(t(k,1),3)))).*DyDz;
    DxWval=detB.*(1./(v(t(k,2),1)-v(t(k,1),1))).*DxW;
    DyWval=detB.*(1./(v(t(k,4),2)-v(t(k,1),2))).*DyW;
    DzWval=detB.*(1./(v(t(k,5),3)-v(t(k,1),3))).*DzW;
    
    AddMatElem(A,indice,indice,2*nu*DxDxval+nu*DyDyval+nu*DzDzval);
    AddMatElem(A,indice+nv2,indice+nv2,nu*DxDxval+2*nu*DyDyval+nu*DzDzval);
    AddMatElem(A,indice+2*nv2,indice+2*nv2,nu*DxDxval+nu*DyDyval+2*nu*DzDzval);
    
    AddMatElem(A,indice,indice+nv2,nu*DxDyval');
    AddMatElem(A,indice+nv2,indice,nu*DxDyval);
    AddMatElem(A,indice,indice+2*nv2,nu*DxDzval');
    AddMatElem(A,indice+2*nv2,indice,nu*DxDzval);
    AddMatElem(A,indice+nv2,indice+2*nv2,nu*DyDzval');
    AddMatElem(A,indice+2*nv2,indice+nv2,nu*DyDzval);
        
    indice1=point(1:8)';
    
    AddMatElem(A,indice,indice1+3*nv2,-DxWval);
    AddMatElem(A,indice+nv2,indice1+3*nv2,-DyWval);
    AddMatElem(A,indice+2*nv2,indice1+3*nv2,-DzWval);
    
    AddMatElem(A,indice1+3*nv2,indice,-DxWval');
    AddMatElem(A,indice1+3*nv2,indice+nv2,-DyWval');
    AddMatElem(A,indice1+3*nv2,indice+2*nv2,-DzWval');
    
end

